function filterBySetInSection(t){var e,n,d,i,o,f,c,r,u,l,a,m,S;e=document.getElementById("input-"+t);n=e.value.toUpperCase();d=document.getElementById("table-"+t);i=d.getElementsByTagName("tr");for(u=0;u<i.length;u++){o=i[u].getElementsByTagName("td")[0];f=i[u].getElementsByTagName("td")[1];c=i[u].getElementsByTagName("td")[2];r=i[u].getElementsByTagName("td")[3];if(o||f||c||r){l=o.textContent||o.innerText;a=f.textContent||f.innerText;m=c.textContent||c.innerText;S=r.textContent||r.innerText;if(l.toUpperCase().indexOf(n)>-1||a.toUpperCase().indexOf(n)>-1||m.toUpperCase().indexOf(n)>-1||S.toUpperCase().indexOf(n)>-1){i[u].style.display=""}else{i[u].style.display="none"}}}}